window.bookSummaryJSON = "<p>From <i>NY Times</i> Best-selling author Bob Mayer: </p> <p>A US Army Special Forces team carrying sterilized weapons and unmarked uniforms is on its way to Colombia. The mission: conduct covert, unilateral raids to destroy cocaine processing laboratories. </p> <p>Of course nothing is as it seems especially once the CIA gets involved. Throw in an Israeli mercenary, betrayal and double-dealing in Washington and the team soon finds itself wondering what the real mission is.</p>"; 
